import './resume.css';
import React from 'react';
import { Card, ListGroup } from 'react-bootstrap';
import { connect } from 'react-redux';

const Resume = (props) => {

    const createJobGroup = (jobs) => {
      console.log(jobs);
      return (
        <div>
          {jobs.map(function(job) {
            return (
              <>
                {job.company}<br></br>
                <small>{job.type} - {job.roll} </small>
                <ul>
                  {/* {(job.whathappened).map(function(whatidid,index){
                    return (
                      <li key={index}>{whatidid}</li>
                    )
                  })} */}
                </ul>
              </>
            );
          })}
        </div>
      ); 
    }

    const createRelevantCourseworkGroup = (classes) => {
      return(
        <div className='row'>
          {classes.map(function(c){
            return(
              <li className='col-lg-4 col-md-6 col-12 mb-1'>
                {c}
              </li>
            )
          })}
        </div>
      )
    }

    const createProjectsGroup = (projects) => {
      return (
        <>
          {projects.map(function(project) {
            return (
              <div className='mb-2'>
                {project.name}<br></br>
                <ul>
                  <li>{project.description}</li>
                  <li>{project.link}</li>
                </ul>
              </div>
            );
          })}
        </>
      );      
    }

    const createSportsGroup = (sports) =>{
      return (
        <>
          {sports.map(function(sport) {
            return (
              <div className='mb-2'>
                {sport.name}<br></br>
                <small>{sport.position}</small>
                <ul>
                  {(sport.accolades).map(function(element){
                    return (
                      <li>{element}</li>
                    )
                  })}
                </ul>
              </div>
            );
          })}
        </>
      );    
    }

    return (
      <div className="container">
        <Card className="justify-content-center">
        <Card.Body>
          <Card.Title className="text-center"> Michael Di Paolo </Card.Title>
          <Card.Subtitle className="mb-2 text-muted text-center">Chicago, Illinois - notdipaolo@outlook.com</Card.Subtitle>  

              <ListGroup variant="flush">
                <ListGroup.Item> 
                  <h5>Education</h5>
                    DePaul University <br></br> 
                    <small>Bachelor of Science in Computer Science - Software Development </small>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Work Experience</h5>
                  {createJobGroup(props.resume.jobs)}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Additional Industry Experience</h5>
                  {createJobGroup(props.resume.additionalIndustryExperience)}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Relevant Coursework</h5>
                  {createRelevantCourseworkGroup(props.resume.relevantCoursework)}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Projects</h5>
                  {createProjectsGroup(props.resume.projects)}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Sports</h5>
                  {createSportsGroup(props.resume.sports)}
                </ListGroup.Item>
              </ListGroup>
          </Card.Body>
        </Card>
      </div>

    )
}

function mapStateToProps(state){
  const resume = state.resumeReducer;
  return {
    resume: resume
  }
}

export default connect(mapStateToProps)(Resume);
